import React from "react";
import styled from "styled-components";

const ItemContainer = styled.div`
    display: flex;
    flex-wrap: wrap;
`;

const item = props => {
    return (
      <div className="item">

      <img  src={props.url}/>
        <h1>
           {props.name} 
        </h1>

        <h2>
        {props.price}
        </h2>
      </div>
    );
  };

  export default item;
